import "./Home.css";
export default function Home(){
    return (<>
        <h1 className="Home">Home</h1>
        <div className="Video">
            <video >
                <source src='/videos/Video.mp4' muted autoPlay loop />
            </video>
        </div>
        </>
    );
}
